UPDATE etfs_ativos_reais 
    SET dividends_12m = CASE symbol
        WHEN 'AIPI' THEN 4.889 WHEN 'SUSL' THEN 1.181 WHEN 'PSFF' THEN 0.001 WHEN 'SCC' THEN 0.983 WHEN 'MSTX' THEN 14.428 WHEN 'BRHY' THEN 1.126 WHEN 'FKU' THEN 1.524 WHEN 'QQQT' THEN 1.167 WHEN 'RPAR' THEN 0.504 WHEN 'REET' THEN 0.978 WHEN 'JKI' THEN 1.9346610000000002 WHEN 'QQQ' THEN 2.819 WHEN 'ITM' THEN 0.441 WHEN 'SCHV' THEN 0.597 WHEN 'ZTAX' THEN 1.2020000000000002 WHEN 'CAAA' THEN 0.44 WHEN 'FDGR' THEN 0.012 WHEN 'AHYB' THEN 0.8949999999999999 WHEN 'MINT' THEN 1.6 WHEN 'IGPT' THEN 3.03
    END,
    updatedat = NOW()
    WHERE symbol IN ('AIPI', 'SUSL', 'PSFF', 'SCC', 'MSTX', 'BRHY', 'FKU', 'QQQT', 'RPAR', 'REET', 'JKI', 'QQQ', 'ITM', 'SCHV', 'ZTAX', 'CAAA', 'FDGR', 'AHYB', 'MINT', 'IGPT');